text_show:
Karakteristik .:
1. 50% pwa chak bò kenbe li balans oto anvan vire sou ak apre fèmen, ak plis ankò ki estab, pi fasil epi san danje monte, espesyalman pou débutan;
2. Modular estrikti, anpil mwens câbles, plis an sekirite, pi ba anpil ki defektye pousantaj (3 pou chak mil) ak plis ankò ki estab;
3. Nou deja te aplike patant a ak li a ki pa kontravansyon ak chik, solowheel oswa razwa, totalman teknoloji diferan ak rive, patant pwòp nou yo.
4. UL2272 ak ASTM sètifika;
5. 8pcs detèktè gravite, pa gros yo regilye 4pcs silicone, plis sansib ak ki estab, pi ba ki defektye to;
6. 7.5 "wou;
7. sistèm kontwòl Double;
8. De wou separeman pa konekte ansanm, gen nan 3 pati pa kounye a 2 pati;
9. demontabl ak batri entèrchanjabl;
10. Double ki pale natif Bluetooth;
11. Manch nan mitan an, pi fasil yo pote;
12. ekran HD nan manch yo montre enfòmasyon.
Pls tcheke videyo a konnen plis sou modèl la Koowheel K5:
https://www.koowheel.com/video/
Features:
1. Samsung orijinal enpòte batri;
2. Taotao Tech menbord;
3. Hanghong motè;
4. Anvan tout koreksyon materyèl te fè kouvri yo ak UV kouvri;
5. Aliminyòm kò alyaj;
6. UL / CE sètifika plato.
Garanti: 2 ane pou Inyon Ewopeyen. / 1 ane pou US
